def process(v):
    cnt_incorrect_pairs = np.array([x[0] for x in v])
    cnt_total_pairs = np.array([x[1] for x in v])
    return np.cumsum(cnt_incorrect_pairs) / np.cumsum(cnt_total_pairs)

